import React, { Component } from 'react';

class ListUserComponent extends Component {
    constructor(props){
        super(props)

        this.state = {
            userEntity: []
        }
    }
    render() {
        return (
            <div>
                <h2 className="text-center">User List</h2>
                <div className="row">
                    <table className="table table-striped table-bordered">

                        <thead>
                            <tr>
                                <th>User username</th>
                                <th>User password</th>
                                <th>User phone</th>
                                <th>User email</th>
                                <th>User status</th>
                                <th>User role</th>
                                <th>User avatar</th>

                            </tr>
                        </thead>

                        <tbody>
                            {
                                this.state.userEntity.map(
                                    user =>
                                    <tr key = {user.id}>
                                        <td>{user.userName}</td>
                                        <td>{user.password}</td>
                                        <td>{user.phone}</td>
                                        <td>{user.email}</td>
                                        <td>{user.status}</td>
                                        <td>{user.role}</td>
                                        <td>{user.avatar}</td>
                                    </tr>
                                )
                            }
                        </tbody>


                    </table>
                </div>

            </div>
        );
    }
}

export default ListUserComponent;
